from dataclasses import dataclass

class Hotel:
    def __init__(self, number, type):
        self.number = number
        self.type = type
    
    def __repr__(self):
        return f"Hotel(number='{self.name}', age={self.age})"

    def __eq__(self, hotel):
        return self.number == hotel.number and self.type == hotel.type
    


